            {/* Freelancing Platforms */}
            <div className="freelancing-platforms mt-3">
              <a href="link_to_platform1" target="_blank" rel="noopener noreferrer">
                <FaBriefcase size={32} className="platform-icon" />
              </a>
              {/* Add similar links/icons for other platforms */}
            </div>
          </div>

          {/* Image */}
          <div className="col-lg-6 text-center">
            {/* ... (rest of your code) */}
          </div>
        </div>
      </div>
    </header>
  );
};

export default Header;
